import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Button } from "react-bootstrap";
import { BodyStyled } from "./Body.styled";


function LargeCard() {
  return (
  
  <BodyStyled>
    <Card backgroundstyle={{ width: '50rem' }}>
      {/* <Card.Img variant="top" src="holder.js/50px100" /> */}
      <Card.Body>
        <Card.Title>Automation</Card.Title>
        <Card.Text>
          Eliminate and Automate with technology.  
        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  </BodyStyled>
)
}
export default LargeCard;
